// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract test {

Project[] public proj; 

function createNew(string memory name) external{
Project pro = new Project(name);
proj.push(pro);
}

    
}

contract Project {
    string public name;
    constructor (string memory name1) {
        name = name1;
    }
}
